def _parse_iso_datetime(s: str) -> datetime:
    # Ej: "2026-01-28T17:30:40.6280000Z"
    # Python no traga bien 7 decimales + 'Z' directo, así que normalizamos.
    s = s.strip()
    if s.endswith("Z"):
        s = s[:-1] + "+00:00"
    # recorta microsegundos a 6 dígitos si vienen más largos
    if "." in s:
        head, tail = s.split(".", 1)
        if "+" in tail:
            frac, tz = tail.split("+", 1)
            frac = (frac + "000000")[:6]
            s = f"{head}.{frac}+{tz}"
        elif "-" in tail:
            frac, tz = tail.split("-", 1)
            frac = (frac + "000000")[:6]
            s = f"{head}.{frac}-{tz}"
        else:
            frac = (tail + "000000")[:6]
            s = f"{head}.{frac}"
    return datetime.fromisoformat(s)


def infer_mode(game: Dict[str, Any]) -> str:
    """
    Convención típica GeoGuessr:
      - moving: se puede mover
      - nm: no moving
      - nmp: no moving + no panning (rotating)
      - nmpz: no moving + no panning + no zooming
    """
    nm = bool(game.get("forbidMoving", False))
    npan = bool(game.get("forbidRotating", False))
    nz = bool(game.get("forbidZooming", False))

    if not nm:
        return "moving"
    if nm and npan and nz:
        return "nmpz"
    if nm and npan:
        return "nmp"
    return "nm"


def extract_day(
    payload: Dict[str, Any],
    *,
    day_index: int,
    override_date: Optional[str] = None
) -> Dict[str, Any]:
    items = payload.get("items", [])
    if not items:
        raise ValueError("El JSON no tiene 'items' o está vacío.")

    # Usamos el primer item como "referencia" para token/mapa/modo/tiempo
    first_game = items[0]["game"]

    # Fecha: la sacamos del primer round startTime del primer item (UTC)
    if override_date:
        date_str = override_date
    else:
        rounds = first_game.get("rounds") or []
        if not rounds or not rounds[0].get("startTime"):
            raise ValueError("No encuentro game.rounds[0].startTime para sacar la fecha.")
        dt = _parse_iso_datetime(rounds[0]["startTime"]).astimezone(timezone.utc)
        date_str = dt.date().isoformat()

    map_id = first_game.get("map")  # id real del mapa (string)
    if not map_id:
        raise ValueError("No encuentro game.map (id del mapa).")

    scores: Dict[str, int] = {}
    for it in items:
        player = it.get("game", {}).get("player", {})  # ojo: en tu log está en game.player
        # En el JSON que pegaste, player cuelga de game: items[i].game.player
        # (si algún log viniera distinto, este fallback ayuda)
        if not player:
            player = it.get("player", {})

        pid = player.get("id")
        total_score = player.get("totalScore", {}).get("amount")
        if pid and total_score is not None:
            # vienen como string, ej "48947"
            try:
                scores[pid] = int(total_score)
            except ValueError:
                pass  # si viene raro, lo saltamos

    day_obj = {
        "date": date_str,
        "dayIndex": int(day_index),
        "token": first_game.get("token"),
        "mapId": map_id,
        "mapName": first_game.get("mapName"),
        "mapUrl": f"https://www.geoguessr.com/maps/{map_id}",
        "mode": infer_mode(first_game),
        "timeLimit": first_game.get("timeLimit"),
        "scores": scores,
    }

    return {date_str: day_obj}


def main():
    payload = json.loads(LOG_TEXT)

    # 2) AJUSTA AQUÍ EL dayIndex DEL DÍA QUE ESTÁS RELLENANDO
    DAY_INDEX = 3

    # 3) Si quieres forzar la fecha (en vez de usar startTime), ponla aquí:
    # OVERRIDE_DATE = "2026-01-21"
    OVERRIDE_DATE = None

    out = extract_day(payload, day_index=DAY_INDEX, override_date=OVERRIDE_DATE)

    # Imprime SOLO el bloque del día, listo para copiar/pegar en tu JSON
    print(json.dumps(out, ensure_ascii=False, indent=2))


if __name__ == "__main__":
    main()
